import { Card, Container } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";
function Home() {
  return (
    <Container className="d-flex justify-content-around">
        <LinkContainer to={"/contacts/page"} style={{ cursor: "pointer" }}>
    <Card style={{ width: '18rem' }}>
      <Card.Body>
        <Card.Img src="https://assets.stickpng.com/images/585e4d1ccb11b227491c339b.png"></Card.Img>
        <Card className="text-center my-1 py-2">Users</Card>
      </Card.Body>
    </Card>
        </LinkContainer>
        <LinkContainer to={"/contacts/page"} style={{ cursor: "pointer" }}>
<Card style={{ width: '18rem' }}>
      <Card.Body>
        <Card.Img src="http://cdn.onlinewebfonts.com/svg/img_147380.png"></Card.Img>
        <Card className="text-center my-1 py-2">Contacts</Card>
      </Card.Body>
    </Card>
        </LinkContainer>
  </Container>
  );
}

export default Home;
